import logo from './logo.svg';
import './App.scss';

const App=()=> {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
       <div>headers></div>
        <p>
          Hello pidor <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>

  );
}

const headers=()=>{
  return(
    <div className="name">
    <ul>
      <li>Хаю бич</li>
      <li>Хаю бичуган</li>
      <li>Хаю пельмень</li>
    </ul>
    </div>
  )
}

export default App;
